{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/mlouis/capstone-bellabeat-case-study-r?scriptVersionId=109109933\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"638ee7ed","metadata":{"papermill":{"duration":0.013485,"end_time":"2022-10-25T17:32:11.48311","exception":false,"start_time":"2022-10-25T17:32:11.469625","status":"completed"},"tags":[]},"source":[" "]},{"cell_type":"markdown","id":"25146eda","metadata":{"papermill":{"duration":0.0117,"end_time":"2022-10-25T17:32:11.506201","exception":false,"start_time":"2022-10-25T17:32:11.494501","status":"completed"},"tags":[]},"source":["# <span style=\"color:#4c5b78\"> Capstone: Bellabeat Case Study | R </span>\n"]},{"attachments":{"d354bbe2-0196-4868-b591-0e98585de80c.png":{"image/png":""}},"cell_type":"markdown","id":"13116c94","metadata":{"papermill":{"duration":0.0115,"end_time":"2022-10-25T17:32:11.528972","exception":false,"start_time":"2022-10-25T17:32:11.517472","status":"completed"},"tags":[]},"source":["![BellaBeatIcons.png](attachment:d354bbe2-0196-4868-b591-0e98585de80c.png)"]},{"cell_type":"markdown","id":"6154b06c","metadata":{"papermill":{"duration":0.011445,"end_time":"2022-10-25T17:32:11.551674","exception":false,"start_time":"2022-10-25T17:32:11.540229","status":"completed"},"tags":[]},"source":["#### Table of Contents\n","\n","\n","\n","* [Ask](#ask)\n","\n","* [Prepare](#prepare)\n","\n","* [Process](#process)\n","\n","* [Analyze](#analyze)\n","\n","* [Share](#share)\n","\n","* [Act](#act)\n","\n","\n","<a id=\"company_background\"></a>\n","## <span style=\"color:#4c5b78\"> Company Background </span> \n","\n","Bellabeat is a small company successful high tech company developing wellness tracking device for women founded in 2013. [Bellabeat](https://bellabeat.com) In 2016 Bellabeat has launched multiple products and expanded their business globally. Initially the products became available on their own e-commerce channel and online retailers. Bellabeat has been focused on digital marketing extensively, including Google Search, video ads, and consumer engagement on social media platforms. "]},{"cell_type":"markdown","id":"4a418e6c","metadata":{"papermill":{"duration":0.01138,"end_time":"2022-10-25T17:32:11.574279","exception":false,"start_time":"2022-10-25T17:32:11.562899","status":"completed"},"tags":[]},"source":["# <span style=\"color:#4c5b78\"> Ask </span> <a class=\"anchor\" id=\"ask\"></a>\n","\n","\n","### The Business Task\n","\n","As a data analyst working on the marketing analyst team, I am tasked with analyzing smart device data to gain insight into consumers usage of their smart devices, and focus on one of Bellabeat's products for reccomendations. In this case study I will be outlining the process of the analysis, key findings, recommend marketing strategies that will be presented to the key stakeholders. \n","\n","- The focus will be on Bellabeat App for recommendations.\n","\n","### Key Stakeholders\n","\n","-   Urka Sren: cofounder and Chief Creative Officer. \n","\n","-   Sando Mur: cofounder and a key member of the Bellabeat executive team. \n","\n","-   Bellabeat marketing analytics team that is responsible for collecting, analyzing,\n","    and reporting data that helps guide Bellabeats marketing strategy. \n","    \n","### Products\n","\n","-   Bellabeat app: provides users with health data related data to their activity, sleep, stress, menstrual cycle, etc.\n","\n","-   Leaf: classic wellness tracker can be worn as a bracelet, necklace, or clip.\n","    \n","-   Time:  wellness watch combines the timeless look of a classic timepiece with smart technology\n","\n","-   Spring: a water bottle that tracks daily water intake using smart technology"]},{"cell_type":"markdown","id":"aaac4ad7","metadata":{"papermill":{"duration":0.01128,"end_time":"2022-10-25T17:32:11.597371","exception":false,"start_time":"2022-10-25T17:32:11.586091","status":"completed"},"tags":[]},"source":["# <span style=\"color:#4c5b78\"> Prepare </span> <a class=\"anchor\" id=\"prepare\"></a>\n","\n","18 CSV files are available from [FitBit Fitness Tracker Data](https://www.kaggle.com/arashnic/fitbit) (CC0: Public Domain, dataset made available through Mobius). The datasets were generated by respondents to a distributed survey via Amazon Mechanical Turk. The metadata has been checked and the dataset has been verified to be open-source, it can be copied, modified, and distributed without permission.\n","\n","Datasets includes 33 Fitbit user activity and trends over a two month period that will help answer the business tasks.\n","\n","I will be using R to prepare, process, analyze and visualize the datasets RStudio Cloud. The files will be uploaded into the RStudio Cloud work directory ../input/fitbit/Fitabase Data 4.12.16-5.12.16.\n","\n","\n"]},{"cell_type":"markdown","id":"2c184f20","metadata":{"papermill":{"duration":0.011181,"end_time":"2022-10-25T17:32:11.619519","exception":false,"start_time":"2022-10-25T17:32:11.608338","status":"completed"},"tags":[]},"source":["### Data limitations\n","\n","  - Small sample size is not ideal (8-33 users within various data sets).\n","  - Demographic information, such as gender and age is unavailable. \n","  - Sampling bias may be present\n","  - The data provided is outdated (2016). "]},{"cell_type":"markdown","id":"e23b6b2c","metadata":{"papermill":{"duration":0.011223,"end_time":"2022-10-25T17:32:11.641776","exception":false,"start_time":"2022-10-25T17:32:11.630553","status":"completed"},"tags":[]},"source":["### Load packages<a class=\"anchor\" id=\"loading_packages\"></a>\n","\n","Packages used in this case study:"]},{"cell_type":"code","execution_count":1,"id":"d6570610","metadata":{"execution":{"iopub.execute_input":"2022-10-25T17:32:11.67079Z","iopub.status.busy":"2022-10-25T17:32:11.