us":"completed"},"tags":[]},"source":["# <span style=\"color:#4c5b78\"> Act  </span> <a class=\"anchor\" id=\"act\"></a>\n","#### Recommendations for Bellabeat app\n","\n","After analyzing the datasets I recommend the following:\n","\n","For users that are sedentary for extended periods of time the BellaBeat app could could send alerts to users to encourage activity. The App could promote social networking features such as a 10k challenge with leaderboard standings among its users to build community and usage of the app. \n","\n","It would be beneficial to explore a larger data set to gain gain further insights into into why users use the app i.e. weight loss, calorie tracking, health maintenance. I would highly recommend surveys to obtain customer feedback."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":15.777763,"end_time":"2022-10-25T17:32:22.945082","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-10-25T17:32:07.167319","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}